import axios from "axios";

const axiosClient = axios.create({
  baseURL: "http://localhost:8080",
  // baseURL: "https://60f6a28418254c00176e0384.mockapi.io",
  headers: {
    "Content-Type": "application/json"
  }
});
export default axiosClient;
